import React, { Component } from 'react';

class Hea extends Component {
  render() {
    return (
      <div>
        <h1>Welcome</h1>
            <img src="./santa.png" alt="image of santa"/>
            <p>To The Polish Campout</p>
            <p>Kris Kringle 2019</p>
      </div>
    );
  }
}

export default Santa;
